let date = new Date()
    let year = date.getFullYear()
    let month_num = date.getMonth()
    const months = ["January", "February", "March", "April", "May", "June", "July", "August", "September", "October", "November", "December"]
    let month = months[month_num]
    let day = date.getDate()
    let weekday_num = date.getDay()
    const weekdays = ["Sunday", "Monday", "Tuesday", "Wednesday", "Thursday", "Friday", "Saturday"]
    let weekday = weekdays[weekday_num]
    let today = weekday + ", " + day.toString() + " " + month + " " + year.toString()

function Date() {

    return (
        <div className="text-green-400 font-semibold text-3xl">
            {today}
        </div>
    )
}

export default Date
